import React, { Component } from 'react';
import './App.css';

class App extends Component {

  state = {
    restaurants: []
  }

  componentDidMount() {
    this.getRestaurants()
  }

  getRestaurants = _ => {
    fetch('http://localhost:5000/restaurants')
    .then(response => response.json())
    .then(response => this.setState({ restaurants: response.data }))
    .catch(err => console.error(err));
  }


  renderRestaurant = ({ restrntID, Name }) => <div key={restrntID}>{Name}</div>

  render() {
    const { restaurants } = this.state
    return (
      <div className="App">
        <table>
          <tr>
            <th></th>
            <th>2</th>
            <th>3</th>
            <th>4</th>
            <th>5</th>
            <th>6</th>
            <tc></tc>
          </tr>
        </table>{restaurants.map(this.renderRestaurant)}
      </div>
    )
  }
}

export default App;
